以下是Java实现的冒泡排序代码部分：

```java
int[] arr = {29, 10, 14, 37, 13};
int n = arr.length;
for (int i = 0; i < n; i++) {
    for (int j = 0; j < n-i-1; j++) {
        if (arr[j] > arr[j+1]) {
            int temp = arr[j];
            arr[j] = arr[j+1];
            arr[j+1] = temp;
        }
    }
}
```
